import React, { Component } from 'react'

import pokemonList from '../pokemon/pokemonlist'

export default class dashboard extends Component {
    render() {
        return (
            <div className="row">
                <div className="col">
                    <pokemonList />
                </div>
            </div>
        )
    }
}
